def selectionSort(myList):
    global loops
    loops = 0
    #select each index in turn.
    #We'll be finding the correct item for that index in each loop.
    for i in range(len(myList)):

        #Find the lowest item in the array from i to the end
        #Everything before i should already be sorted!
        lowind = i
        for j in range(i+1, (len(myList))):
            loops +=1
            if myList[lowind] > myList[j]:
                lowind = j


        #Swap the minimum element with the element at location i
        myList[i],myList[lowind] = myList[lowind], myList[i]

    return (myList, loops)

